import styled from "styled-components";
import "./../App.css";
const Head = styled.div`
	background-color: ${(props) => props.color};
	padding: 25px 30px;
`;
const HomeProfile = styled.h1`
	font-size: 1.5em;
	text-align: start;
	color: palevioletred;
	margin: 0;
	float: left;
`;

const ProfileAvatar = styled.div`
	text-align: end;
	font-size: 1.5em;
`;
const Header = ({ background }: any) => {
	return (
		<>
			<Head color="red">
				<HomeProfile>Headers</HomeProfile>
				<ProfileAvatar>P</ProfileAvatar>
			</Head>
		</>
	);
};
export default Header;
